};

// Inline Styling
const styles = {
  container: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    gap: "20px",
    backgroundColor: "#f8f9fa",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
  },
  icon: {
    fontSize: "40px",
    textAlign: "center",
    padding: "10px",
    border: "2px solid #ff6347",
    borderRadius: "50%",
    width: "80px",
    height: "80px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#fff",
    transition: "transform 0.3s ease, box-shadow 0.3s ease",
    cursor: "pointer",
  },
  label: {
    fontSize: "14px",
    color: "#333",
    marginTop: "5px",
  },
  iconHover: {
    transform: "scale(1.1)",
    boxShadow: "0 8px 15px rgba(0, 0, 0, 0.2)",
  },
};

// Adding hover effect with JavaScript
const addHoverEffect = () => {
  const icons = document.querySelectorAll("div[style]");
  icons.forEach((icon) => {
    icon.addEventListener("mouseover", () => {
      Object.assign(icon.style, styles.iconHover);
    });
    icon.addEventListener("mouseout", () => {
      Object.assign(icon.style, styles.icon);
    });
  });
};

// Attach hover effects after component is rendered
React.useEffect(() => {
  addHoverEffect();
}, []);

export default FoodIcons;
